import Link from "next/link";
const Navbar = ()=> (
    <nav className="navbar">
    <head>
    <script src="https://kit.fontawesome.com/0ad3c3f5c3.js" crossorigin="anonymous"></script>
    </head>
    <ul className="navbar-nav">
      <li className="nav-item">
        <a href="#" className="nav-link">
        <i class="far fa-newspaper"></i>
        </a>
      </li>
    </ul>
    <style jsx>
      {`
      .navbar{
        width: 5rem;
        height: 100vh;
        position:fixed;
        background-color: #2A2E35;
      }
      .navbar-nav{
        list-style: none;
        padding: 0;
        display: flex
      }
      `}
    </style>
  </nav>
);

export default Navbar;
